gfs()::Vector{Float64} = [parse(Float64,x) for x in gss()]

function gengraph(seed::I)::Tuple{Array{Int8,2},I}
    rng = Random.MersenneTwister(seed)
    n::I = rand(rng,10:13)
    p::F = 2.9/n*rand(rng)
    gr::Array{Int8,2} = [i>=j ? Int8(0) : rand(rng) < p ? Int8(1) : Int8(0) for i in 1:n,j in 1:n]
    parents::VI = [rand(rng,1:j-1) for j in 2:n]
    for j in 2:n; i = parents[j-1]; gr[i,j] = 1; end
    for i in 1:n-1; for j in i+1:n; gr[j,i] = gr[i,j]; end; end
    return (gr,n)
end

function countSpanningTrees(gr::Array{Int8,2},n::I)::I
    matrix::Array{Int8,2} = Int8(-1) .* gr
    xx::Vector{Int8} = [sum(gr[i,:]) for i in 1:n]
    for i in 1:n; matrix[i,i] = xx[i]; end
    gr2::Array{Int8,2} = matrix[2:end,2:end]
    return floor(Int64,det(gr2)+0.5)
end

