function main(infn="")
    global infile
    infile = (infn != "") ? open(infn,"r") : length(ARGS) > 0 ? open(ARGS[1],"r") : stdin
    seedarr = genSeedArr()
    tt::I = gi()
    for qq in 1:tt
        print("Case #$qq: ")
        K = gi()
        if K <= 22
            n = K
            gr = fill(0,n,n)
            for i in 1:n; j = i == n ? 1 : i+1; gr[i,j] = gr[j,i] = 1; end
        else
            (gr,n) = gengraph(seedarr[K])
        end
        print("$n\n")
        for i in 1:n; println(join(gr[i,:],"")); end
    end
end

function prework()
    sb::VI = fill(-1,10000)
    for i in 1:22; sb[i] = 0; end
    for i in 1:4000000
        if i % 100000 == 0
            miss = count(x->x==-1,sb)
            print("Running $i/4000000  missing:$miss\n")
            if miss == 0; break; end
        end
        (gr,n) = gengraph(i)
        st = countSpanningTrees(gr,n)
        if st > 10000; continue; end
        if sb[st] == -1; sb[st] = i; end
    end
    l = join(sb," ")
    print("function genSeedArr()\n")
    print("    s = \"$l\"\n")
    print("    ss = [parse(Int64,x) for x in split(s)]\n")
    print("    return ss\n")
    print("end\n")
end

function check()
    seedarr = genSeedArr()
    for i in 3:10000
        if i <= 22
            n = i
            gr = fill(Int8(0),n,n)
            for i in 1:n; j = i == n ? 1 : i+1; gr[i,j] = gr[j,i] = Int8(1); end
        else
            (gr,n) = gengraph(seedarr[i])
        end
        xx = countSpanningTrees(gr,n)
        if xx != i; print("ERROR: i:$i xx:$xx\n"); end
    end
end

